import { Button, Dialog, DialogContentText, DialogTitle, TableCell, TableRow } from "@mui/material"



export const Linha = ({ row, labelId }) => {

    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
        setOpen(true);
      };
    
      const handleClose = () => {
        setOpen(false);
      };

    const EnviarGRT = () => {
